import PageHeader from '../../components/PageHeader/PageHeader';
import DataCard from '../../components/DataCard/DataCard';

export default props => {
  return (
    <div>
      <PageHeader
        title="page header"
        actions={[{ text: 'Add', handler: null }]}
      />
      <DataCard
        data={[
          {
            data:{
              number:"12345",
              type:"Vehicle Reg",
              submittedDate:"29/08/2019",
              DueDate:"04/09/2019",
              depth:"04/09/2019"
            },
            actions:{
              cardClick:null
            }

          },
          { title: 'title1', desc: 'Testing' },
          { title: 'title1', desc: 'Testing' },
          { title: 'title1', desc: 'Testing' }
        ]}
      />
    </div>
  );
};
